    <h2 style="text-align: center; font-weight: bold; text-transform: uppercase; margin-bottom: 5px; font-size: 24px;">ĐIỀU KHOẢN VÀ ĐIỀU KIỆN DỊCH VỤ VẬN CHUYỂN</h2>
    <p style="text-align: center; font-style: italic; margin-bottom: 20px; font-size: 14px;">(Tuân thủ Bộ luật Dân sự 2015, Luật Thương mại 2005 và Luật Thuế GTGT)</p>
    <hr style="border: 0; border-top: 2px solid #000; margin-bottom: 30px;">

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 1. ĐỊNH NGHĨA VÀ PHẠM VI DỊCH VỤ</h3>
    
    <p><strong>1.1. Các bên tham gia:</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>"Bên Vận Chuyển"</strong> (Chúng tôi): Là đơn vị cung cấp nền tảng công nghệ, phương tiện và tài xế để thực hiện dịch vụ vận tải.</li>
        <li><strong>"Khách Hàng"</strong> (Bên A): Là cá nhân hoặc tổ chức thực hiện việc đặt đơn hàng, ký kết hợp đồng và thanh toán cước phí.</li>
        <li><strong>"Đơn hàng"</strong>: Là yêu cầu vận chuyển đã được xác nhận trên hệ thống bao gồm thông tin hàng hóa, điểm đi, điểm đến và cước phí.</li>
    </ul>

    <p><strong>1.2. Phạm vi cung cấp dịch vụ:</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Phương thức:</strong> Vận chuyển đường bộ nội thành.</li>
        <li><strong>Phương tiện:</strong> Dịch vụ chỉ được thực hiện bằng <strong>XE TẢI</strong>. Các loại phương tiện khác (xe máy, container đầu kéo, xe ba gác) không thuộc phạm vi phục vụ của Hệ thống.</li>
        <li><strong>Khu vực:</strong> Giới hạn trong phạm vi Thành phố Hồ Chí Minh.</li>
        <li><strong>Tải trọng:</strong> Tổng khối lượng hàng hóa cho phép vận chuyển phải nằm trong khoảng từ <strong>0.01 tấn (10 kg) đến 50 tấn</strong>. Lưu ý: Khối lượng tối đa của một kiện hàng riêng lẻ (package) phải từ <strong>0.01 tấn (10 kg)</strong> đến <strong>10 tấn</strong>. Khách hàng có thể tạo đơn với nhiều kiện hàng.</li>
    </ul>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 2. QUY ĐỊNH VỀ HÀNG HÓA</h3>

    <p><strong>2.1. Hàng hóa Hợp lệ:</strong> Hệ thống chấp nhận vận chuyển hàng tiêu dùng nhanh (FMCG), hàng điện tử, hàng may mặc, tài liệu/bưu phẩm và các loại hàng hóa thông thường không yêu cầu điều kiện bảo quản đặc biệt (nhiệt độ, độ ẩm).</p>

    <p><strong>2.2. Hàng hóa CẤM VẬN CHUYỂN và Miễn trừ trách nhiệm:</strong></p>
    <p style="margin-left: 20px;">Khách hàng cam kết tuyệt đối không gửi các mặt hàng sau:</p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li>Thực phẩm tươi sống, hàng đông lạnh, sinh vật sống.</li>
        <li>Vũ khí, đạn dược, vật liệu nổ, chất ma túy, chất kích thích.</li>
        <li>Tiền mặt, đá quý, các giấy tờ có giá trị như tiền.</li>
        <li>Bất kỳ hàng hóa nào bị pháp luật Việt Nam cấm lưu thông (Theo Luật Giao thông đường bộ 2008).</li>
    </ul>
    <p style="margin-left: 20px;"><strong>2.3. Miễn trừ trách nhiệm pháp lý:</strong> Bên Vận Chuyển không chịu trách nhiệm pháp lý nếu hàng hóa bị cơ quan chức năng kiểm tra, tịch thu hoặc tiêu hủy do Khách hàng vi phạm quy định về hàng cấm. Khách hàng phải chịu trách nhiệm bồi thường toàn bộ thiệt hại gây ra cho Bên Vận Chuyển trong trường hợp này.</p>

    <p><strong>2.4. Quy cách đóng gói và Tính cước:</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Trách nhiệm đóng gói:</strong> Khách hàng chịu hoàn toàn trách nhiệm về quy cách đóng gói. Bên Vận Chuyển không chịu trách nhiệm bồi thường các hư hỏng do lỗi đóng gói nội bộ (hàng vỡ bên trong kiện còn nguyên seal).</li>
        <li><strong>Quy đổi trọng lượng:</strong> Đối với hàng lỏng hoặc hàng cồng kềnh, Khách hàng bắt buộc phải quy đổi sang trọng lượng (kg/tấn) trước khi tạo đơn hàng trên hệ thống.</li>
    </ul>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 3. NGHĨA VỤ XÁC MINH VÀ GIAO NHẬN (BÊN A)</h3>

    <p><strong>3.1. Đảm bảo tính chính xác của Trọng lượng (Theo Thông tư 46/2015/TT-BGTVT):</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Độ chính xác:</strong> Khách hàng chịu trách nhiệm tuyệt đối về sự chính xác của trọng lượng khai báo trên hệ thống.</li>
        <li><strong>Quyền từ chối tại chỗ:</strong> Nếu trọng lượng thực tế vượt quá tải trọng pháp lý cho phép của phương tiện hoặc vượt quá trọng lượng đã khai báo <strong>quá 5%</strong> (hoặc mức cho phép khác theo thỏa thuận), Tài xế có quyền từ chối nhận hàng và Hợp đồng bị hủy (xem chính sách phạt hủy ở Điều 4.6).</li>
        <li><strong>Chứng từ:</strong> Khách hàng có nghĩa vụ cung cấp các chứng từ cân đo, biên lai trạm cân hoặc các giấy tờ chứng thực trọng lượng khác theo yêu cầu của Tài xế hoặc Bên Vận Chuyển.</li>
    </ul>

    <p><strong>3.2. Giấy tờ pháp lý (Điều 535 Luật Thương mại 2005):</strong></p>
    <p style="margin-left: 20px;">Khách hàng có nghĩa vụ cung cấp đầy đủ Hóa đơn giá trị gia tăng, Phiếu xuất kho kiêm vận chuyển nội bộ hoặc các chứng từ hợp pháp khác kèm theo hàng hóa để Tài xế xuất trình khi lưu thông trên đường.</p>

    <p><strong>3.3. Xếp dỡ hàng hóa:</strong></p>
    <p style="margin-left: 20px;">Trừ khi có thỏa thuận khác trong Hợp đồng, trách nhiệm và chi phí xếp hàng lên xe tại điểm đi và dỡ hàng xuống xe tại điểm đến thuộc về Khách hàng. Tài xế chỉ có trách nhiệm giám sát việc xếp hàng để đảm bảo an toàn cho phương tiện.</p>

    <p><strong>3.4. Nghiêm cấm Gian lận và Khai khống (Anti-Fraud Policy):</strong></p>
    <p style="margin-left: 20px;">Chúng tôi áp dụng chính sách "Không khoan nhượng" đối với mọi hành vi gian lận. Khách hàng cam kết tính trung thực của thông tin và không thực hiện các hành vi sau:</p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Khai khống Giá trị (Trục lợi bảo hiểm):</strong> Cố ý khai báo giá trị hàng hóa cao hơn thực tế, sử dụng hóa đơn giả mạo hoặc chứng từ không hợp lệ nhằm mục đích trục lợi tiền bồi thường khi có sự cố.</li>
        <li><strong>Khai khống Trọng lượng/Kích thước:</strong> Cố ý khai báo sai lệch trọng lượng hoặc kích thước hàng hóa thấp hơn thực tế nhằm giảm cước phí vận chuyển.</li>
        <li><strong>Gian lận hiện trạng hàng hóa:</strong> Gửi hàng đã hư hỏng, vỡ nát, hàng cũ nhưng khai báo là hàng mới/nguyên vẹn; hoặc tráo đổi ruột hàng hóa (tráo hàng thật bằng hàng giả/kém chất lượng) trước khi đóng Seal.</li>
        <li><strong>Thông đồng gian lận:</strong> Có hành vi móc nối, hối lộ hoặc thông đồng với Tài xế/Nhân viên của Bên Vận Chuyển để làm sai lệch hồ sơ, lộ trình hoặc chiếm đoạt tài sản.</li>
    </ul>
    <p style="margin-left: 20px;"><em>Chế tài xử lý:</em> Trường hợp phát hiện gian lận, Bên Vận Chuyển có quyền <strong>đơn phương chấm dứt hợp đồng ngay lập tức</strong>, giữ lại toàn bộ cước phí và hàng hóa để phục vụ công tác điều tra, <strong>từ chối vĩnh viễn mọi trách nhiệm bồi thường/bảo hiểm</strong>, và chuyển hồ sơ sang cơ quan Công an nếu có dấu hiệu tội phạm.</p>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 4. QUY ĐỊNH VỀ HỢP ĐỒNG VÀ THANH TOÁN</h3>

    <p><strong>4.1. Điều kiện Xác lập Hợp đồng:</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li>Mọi đơn hàng đều bắt buộc phải có Hợp đồng vận chuyển (Contract). Hợp đồng chỉ có hiệu lực khi cả hai bên xác nhận ký điện tử trên hệ thống.</li>
        <li><strong>Thời gian đặt hàng:</strong> Ngày lấy hàng dự kiến không được sớm hơn <strong>02 (hai) ngày</strong> tính từ thời điểm Khách hàng tạo đơn trên hệ thống.</li>
    </ul>

    <p><strong>4.2. Điều khoản Đặt cọc (Deposit) - Quy định nghiêm ngặt:</strong></p>
    <p style="margin-left: 20px;">Khách hàng phải tiến hành thanh toán khoản đặt cọc ngay sau khi ký Hợp đồng. Nếu hệ thống không ghi nhận khoản cọc trong vòng <strong>24 giờ</strong> kể từ thời điểm ký, Đơn hàng và Hợp đồng sẽ bị <strong>HỦY TỰ ĐỘNG</strong> (Theo Điều 423 Bộ luật Dân sự 2015 về hủy bỏ hợp đồng).</p>

    <p><strong>4.3. Điều khoản Thanh toán toàn bộ:</strong></p>
    <p style="margin-left: 20px;">Khoản thanh toán còn lại của Hợp đồng phải được hoàn tất tối thiểu <strong>01 (một) ngày</strong> trước ngày lấy hàng dự kiến. <strong>Nếu quá thời hạn này mà chưa thanh toán đủ, Đơn hàng và Hợp đồng sẽ bị HỦY TỰ ĐỘNG.</strong></p>

    <p><strong>4.4. Quyền Cầm giữ hàng hóa (Lien on Goods) (Theo Điều 346 Bộ luật Dân sự 2015):</strong></p>
    <p style="margin-left: 20px;">Trong trường hợp Khách hàng không thanh toán đầy đủ cước phí vận chuyển hoặc các chi phí phát sinh hợp lý (phí lưu kho, phí bến bãi, phí chờ, chi phí phạt do quá tải), Bên Vận Chuyển có quyền thực hiện <strong>quyền cầm giữ hàng hóa</strong> đang vận chuyển cho đến khi Khách hàng hoàn thành nghĩa vụ thanh toán.</p>

    <p><strong>4.5. Quyền Hủy Hàng Trả về do Thiếu Phí Hoàn:</strong></p>
    <p style="margin-left: 20px;">Trong trường hợp hàng hóa bị hoàn trả (Return) do không giao được, Khách hàng có nghĩa vụ thanh toán cước phí vận chuyển chiều về. Nếu Khách hàng <strong>không hoàn tất thanh toán cước phí chiều về trong vòng 30 phút</strong> kể từ thời điểm hệ thống/Nhân viên gửi yêu cầu thanh toán, Bên Vận Chuyển có quyền <strong>hủy việc trả hàng</strong> và tiến hành xử lý hàng hóa theo quy định tại Điều 6.2 (Quyền định đoạt hàng hóa).</p>

    <p><strong>4.6. Chính sách Phạt Hủy và Từ chối phục vụ (Tại chỗ):</strong></p>
    <p style="margin-left: 20px;">Trong trường hợp đơn hàng bị hủy hoặc Tài xế từ chối phục vụ tại chỗ do lỗi của Khách hàng (Quá tải, Sai quy cách đóng gói, Hàng cấm, Gian lận theo Điều 3.4) hoặc Khách hàng đơn phương hủy sau khi xe đã di chuyển:</p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Phí phạt:</strong> Bên Vận Chuyển sẽ <strong>giữ lại 100% cước phí đã thu</strong> (bao gồm cọc và các khoản đã thanh toán).</li>
        <li><strong>Cơ chế:</strong> Chúng tôi <strong>KHÔNG thu thêm</strong> bất kỳ khoản phí phạt nào khác. Khoản tiền đã mất này được xem là phí bồi hoàn chi phí vận hành (nhiên liệu, nhân sự) theo thỏa thuận phạt vi phạm (Điều 418 Bộ luật Dân sự 2015).</li>
    </ul>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 5. QUY ĐỊNH VẬN HÀNH VÀ NIÊM PHONG (SEAL)</h3>

    <p><strong>5.1. Quy trình tại điểm xuất phát:</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li>Trước khi khởi hành, Tài xế phải thực hiện checklist kiểm tra phương tiện và hàng hóa.</li>
        <li>Thùng xe tải/Container phải được niêm phong (Seal) sau khi xếp hàng xong. Tài xế có trách nhiệm chụp ảnh Seal đã niêm phong và cập nhật lên hệ thống.</li>
        <li><strong>Thông báo Seal:</strong> Ngay khi Tài xế cập nhật trạng thái niêm phong, hệ thống tự động gửi Email chứa Mã Seal và Ảnh chụp cho Khách hàng (Người gửi). Người gửi có trách nhiệm thông báo mã này cho Người nhận để đối chiếu khi nhận hàng.</li>
        <li>Tài xế tuyệt đối không được tự ý thay đổi hoặc phá Seal nếu không có sự cho phép từ Nhân viên điều phối (Staff).</li>
    </ul>

    <p><strong>5.2. Giám sát hành trình (GPS):</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li>Khách hàng đồng ý cho phép hệ thống thu thập dữ liệu vị trí xe tải theo thời gian thực trong suốt quá trình thực hiện đơn hàng.</li>
        <li>Tín hiệu GPS được cập nhật định kỳ tối thiểu mỗi <strong>60 giây</strong>. Nếu mất tín hiệu quá 2 phút, hệ thống sẽ phát cảnh báo an ninh (Tuân thủ Nghị định 10/2020/NĐ-CP).</li>
        <li>Tài xế không được tự ý thay đổi tuyến đường đã được chỉ định. Mọi sự thay đổi tuyến đường phải được sự chấp thuận của hệ thống.</li>
    </ul>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 6. GIAO NHẬN, TRẢ HÀNG VÀ XỬ LÝ SỰ CỐ</h3>

    <p><strong>6.1. Xác nhận Giao hàng (POD):</strong></p>
    <p style="margin-left: 20px;">Tại điểm đến, Người nhận hàng có trách nhiệm kiểm tra tình trạng Niêm phong (Seal), số lượng kiện hàng và ký xác nhận (ký giấy hoặc ký điện tử). Đơn hàng chỉ được xem là Hoàn tất khi có ảnh chụp bằng chứng giao hàng (Proof of Delivery) và dữ liệu định vị tại điểm giao.</p>

    <p><strong>6.2. Quy trình Trả hàng (Return Policy) - Quan trọng:</strong></p>
    <p style="margin-left: 20px;">Trong trường hợp giao hàng thất bại (do Người nhận từ chối nhận, không liên lạc được, hoặc địa chỉ không chính xác):</p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li>Quy trình hoàn trả hàng về điểm xuất phát sẽ được kích hoạt.</li>
        <li>Khách hàng (Bên gửi) có nghĩa vụ thanh toán <strong>100% cước phí vận chuyển chiều về</strong> cho Tài xế.</li>
        <li><strong>Quyền định đoạt hàng hóa (Theo Điều 350 Bộ luật Dân sự 2015):</strong> Nếu Khách hàng từ chối thanh toán cước phí chiều về (hoặc quá thời hạn 30 phút tại Điều 4.5), Bên Vận Chuyển có quyền từ chối vận chuyển hàng quay lại và <strong>để lại hàng hóa tại địa điểm giao</strong> hoặc đưa về kho để xử lý thanh lý bù đắp chi phí. Bên Vận Chuyển được miễn trừ hoàn toàn trách nhiệm bảo quản đối với lô hàng này.</li>
    </ul>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 7. QUY TẮC BẢO HIỂM, BỒI THƯỜNG VÀ GIỚI HẠN TRÁCH NHIỆM</h3>

    <p><strong>7.1. Căn cứ Kích hoạt Trách nhiệm Bồi thường:</strong></p>
    <p style="margin-left: 20px;">Trách nhiệm bồi thường của Bên Vận Chuyển <strong>chỉ phát sinh</strong> khi tổn thất hoặc hư hỏng hàng hóa được xác định là do <b>lỗi chủ quan</b>&nbsp;của Bên Vận Chuyển, Tài xế hoặc người đại diện của Công ty. Bên Vận Chuyển được miễn trừ trách nhiệm bồi thường khi tổn thất xảy ra do lỗi của Khách hàng (bao gồm lỗi do gian lận nêu tại Điều 3.4), lỗi do bên thứ ba, hoặc do các nguyên nhân bất khả kháng (Xem Mục 7.7).</p>

    <p><strong>7.2. Phạm vi Bồi thường và Loại trừ (Điều 360 Bộ luật Dân sự 2015):</strong></p>
    <p style="margin-left: 20px;">Bên Vận Chuyển chỉ chịu trách nhiệm bồi thường cho <b>Thiệt hại Trực tiếp</b>. Tổng số tiền bồi thường bao gồm:</p>
    <ul style="list-style-type: circle; padding-left: 40px; margin-bottom: 10px;">
        <li>Giá trị vật chất thực tế của hàng hóa bị tổn thất.</li>
        <li>Cước phí vận chuyển đã thu đối với lô hàng đó (được tính toán cụ thể tại Điều 7.5).</li>
    </ul>
    <p style="margin-left: 20px;">Chúng tôi <b>miễn trừ </b>mọi trách nhiệm đối với <b>Thiệt hại Gián tiếp</b>&nbsp;(bao gồm nhưng không giới hạn: mất lợi nhuận, đình trệ sản xuất, mất cơ hội kinh doanh).</p>

    <p><strong>7.3. Thời hạn và Quy trình khiếu nại (Theo Điều 318 Luật Thương mại 2005):</strong></p>
    <p style="margin-left: 20px;">Mọi sự cố hư hỏng, mất mát hoặc thiếu hụt hàng hóa phải được lập biên bản và báo cáo ngay lập tức lên hệ thống tại thời điểm giao hàng. Thời hiệu khiếu nại tối đa là 03 (ba) tháng. Chúng tôi từ chối giải quyết mọi khiếu nại phát sinh sau khi Tài xế đã rời khỏi điểm giao và đơn hàng đã chuyển trạng thái "Hoàn thành".</p>

    <p><strong>7.4. Chính sách Bảo hiểm và Giới hạn Trách nhiệm:</strong></p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Trường hợp KHÔNG mua Bảo hiểm (Trách nhiệm Mặc định - Theo Điều 546 Luật Thương mại 2005):</strong> Trách nhiệm bồi thường của Bên Vận Chuyển được giới hạn tối đa <strong>10 lần cước phí vận chuyển</strong> của lô hàng bị thiệt hại. Khách hàng chấp nhận rủi ro đối với giá trị hàng hóa vượt quá giới hạn này.</li>
        <li><strong>Trường hợp CÓ mua Bảo hiểm (Trách nhiệm Mở rộng - Theo Luật Kinh doanh Bảo hiểm 2022):</strong>
            <ul style="list-style-type: circle; padding-left: 40px; margin-top: 5px;">
                <li><strong>Phí Bảo hiểm (Đã bao gồm VAT):</strong> Khách hàng phải khai báo Giá trị hàng hóa (Declared Value). Phí được tính dựa trên Giá trị Khai báo với tỷ lệ do Công ty Bảo hiểm đối tác quy định (Ví dụ: 0.08% cho Hàng Thường, 0.15% cho Hàng Dễ Vỡ). <b>Phí này chưa bao gồm Thuế GTGT (VAT). Thuế VAT sẽ được cộng thêm vào Tổng phí bảo hiểm theo quy định của pháp luật hiện hành.</b>&nbsp;<em>Lưu ý: Bên Vận Chuyển chỉ thực hiện thu hộ tổng phí này (bao gồm cả VAT) cho đơn vị Bảo hiểm.</em></li>
                <li><strong>Điều kiện Vô hiệu hóa:</strong> Khách hàng <strong>BẮT BUỘC</strong> phải cung cấp đầy đủ Hóa đơn, Chứng từ hợp pháp để chứng minh giá trị hàng hóa khi có sự cố. Nếu không chứng minh được, hoặc khai báo sai lệch/gian lận, Bảo hiểm sẽ bị vô hiệu hóa và trách nhiệm bồi thường của Bên Vận Chuyển sẽ chuyển về mức giới hạn 10 lần cước phí vận chuyển (hoặc từ chối hoàn toàn theo Điều 3.4).</li>
            </ul>
        </li>
    </ul>

    <p><strong>7.5. Quy tắc Xác định Giá trị Bồi thường và Thẩm định (Khi thiếu/sai lệch chứng từ):</strong></p>
    <p style="margin-left: 20px;">Trong trường hợp xảy ra sự cố:</p>
    <ul style="list-style-type: disc; padding-left: 40px; margin-bottom: 10px;">
        <li><strong>Trường hợp CÓ Hóa đơn nhưng lệch Giá trị Khai báo (Theo Điều 45 &amp; Điều 47 Luật Kinh doanh Bảo hiểm 2022):</strong>
            <ul style="list-style-type: circle; padding-left: 20px; margin-top: 5px;">
                <li>Nếu Giá trị Hóa đơn <strong>NHỎ HƠN</strong> Giá trị Khai báo: Bồi thường theo <strong>Giá trị Hóa đơn (Thực tế)</strong>.</li>
                <li>Nếu Giá trị Hóa đơn <strong>LỚN HƠN</strong> Giá trị Khai báo: Bồi thường tối đa bằng <strong>Giá trị Khai báo</strong> (Áp dụng nguyên tắc Bảo hiểm dưới giá trị).</li>
            </ul>
        </li>
        <li><strong>Trường hợp KHÔNG có Hóa đơn (Bảo hiểm vô hiệu):</strong>
            <ul style="list-style-type: circle; padding-left: 20px; margin-top: 5px;">
                <li>Mức bồi thường cuối cùng sẽ là giá trị <strong>NHỎ HƠN</strong> giữa [Giá trị thiệt hại ước tính theo thị trường] và [Giới hạn 10 lần cước phí].</li>
            </ul>
        </li>
        <li><strong>Nguyên tắc Hoàn trả Cước phí (Pro-rata) do lỗi Vận Chuyển:</strong>
            <ul style="list-style-type: circle; padding-left: 20px; margin-top: 5px;">
                <li><strong>Hư hỏng toàn bộ:</strong> Bên Vận Chuyển hoàn trả 100% Cước phí vận chuyển đã thu của đơn hàng + Giá trị hàng hóa (theo hạn mức trách nhiệm).</li>
                <li><strong>Hư hỏng một phần (Partial Loss):</strong> Bên Vận Chuyển chỉ hoàn trả phần cước phí vận chuyển <strong>tương ứng theo tỷ lệ</strong> (dựa trên trọng lượng hoặc kích thước) của phần hàng hóa bị hư hỏng + Giá trị của phần hàng đó.</li>
            </ul>
        </li>
        <li><strong>Thẩm định độc lập:</strong> Nếu không đồng ý với mức thẩm định của Bên Vận Chuyển, Khách hàng có quyền thuê Giám định viên độc lập. Chi phí giám định sẽ do Bên Vận Chuyển chịu nếu kết quả cho thấy lỗi thuộc về Vận Chuyển hoặc mức thẩm định ban đầu thấp hơn thực tế quá 10% so với giá trị bồi thường cuối cùng; ngược lại sẽ do Khách hàng chịu.</li>
    </ul>

    <p><strong>7.6. Trách nhiệm đối với hành vi vi phạm pháp luật của Nhân viên (Lỗi Cố Ý):</strong></p>
    <p style="margin-left: 20px;">Trong trường hợp tổn thất hàng hóa xảy ra do hành vi cố ý vi phạm pháp luật hình sự của Tài xế (như trộm cắp, chiếm đoạt tài sản, bỏ trốn), Bên Vận Chuyển cam kết chịu trách nhiệm bồi thường cho Khách hàng theo <strong>100% Giá trị thực tế</strong> của lô hàng (dựa trên hóa đơn chứng từ hợp pháp), <b>cộng thêm toàn bộ Cước phí Vận chuyển đã thu</b>, NHƯNG KHÔNG bao gồm các thiệt hại gián tiếp, và <b>KHÔNG áp dụng các giới hạn trách nhiệm thông thường</b> (Theo Điều 600 BLDS 2015 và Khoản 1 Điều 294 Luật Thương mại 2005). Bên Vận Chuyển có trách nhiệm phối hợp với cơ quan chức năng để xử lý vụ việc.</p>

    <p><strong>7.7. Bất khả kháng (Theo Điều 351 Bộ luật Dân sự 2015):</strong></p>
    <p style="margin-left: 20px;">Bên Vận Chuyển được miễn trừ trách nhiệm trong các trường hợp bất khả kháng bao gồm nhưng không giới hạn: Thiên tai, hỏa hoạn, đình công, cấm đường đột xuất của cơ quan nhà nước, hoặc tai nạn giao thông không do lỗi chủ quan của Tài xế. Trong trường hợp này, hai bên có thể thỏa thuận thay đổi lịch giao hàng nếu thông báo trước 02 ngày.</p>

    <h3 style="text-align: left; font-weight: bold; text-transform: uppercase; margin-top: 30px; margin-bottom: 15px; font-size: 18px; border-bottom: 1px solid #ccc; padding-bottom: 5px;">ĐIỀU 8. BẢO MẬT THÔNG TIN VÀ LUẬT ÁP DỤNG</h3>

    <p><strong>8.1. Bảo mật dữ liệu (Theo Nghị định 13/2023/NĐ-CP):</strong></p>
    <p style="margin-left: 20px;">Mọi quy trình thu thập, lưu trữ, xử lý dữ liệu GPS, hình ảnh đơn hàng và thông tin cá nhân của Khách hàng/Tài xế đều cam kết tuân thủ Luật An ninh mạng và Luật Bảo vệ dữ liệu cá nhân tại Việt Nam.</p>

    <p><strong>8.2. Luật điều chỉnh và Giải quyết tranh chấp:</strong></p>
    <p style="margin-left: 20px;">Các Điều khoản này được điều chỉnh bởi pháp luật Việt Nam. Mọi tranh chấp không thể thương lượng sẽ được giải quyết tại <strong>Tòa án có thẩm quyền tại Thành phố Hồ Chí Minh</strong>.</p>
    
    <br>
    <p style="text-align: center; font-weight: bold; margin-top: 40px; border-top: 2px double #000; padding-top: 10px;">--- KẾT THÚC ĐIỀU KHOẢN DỊCH VỤ ---</p>
